messages.formattedText:
Абонемент на __пригородные__ _поезда_ – это билет для **многократного** *проезда*. Его можно записать на *транспортные карты*:
- «Тройка»;
- «Стрелка»;
- ЦППК;
- социальные;
- индивидуальные транспортные карты (ИТК).
Обращайтесь к кассирам на ж/д станциях или записывайте билеты самостоятельно в билетопечатающих автоматах. Будьте внимательны: чек об оплате разового билета или абонемента не даёт право на проезд.
Об абонементах на электрички всех направлений, кроме Ленинградского, читайте на сайте ЦППК: https://central-ppk.ru/new/tariffs/info/abonementy/, на поезда Ленинградского направления – на сайте МТ ППК: https://mtppk.ru/passengers/passes/. 
[__*Схема метро*__](https://mosmetro.ru/metro-map/)
